import React from 'react'
import NewApp from './NewApp'
import {BrowserRouter,Routes,Route, useParams} from 'react-router-dom'

const NewHome = () => {
    
    let {id} = useParams()

  return (
    <div>

<BrowserRouter>
<Routes>

<Route path='/:id' element={<NewApp/>}   />


</Routes>
</BrowserRouter>






    </div>
  )
}

export default NewHome
